import React from 'react';
import * as selectors from '../../reducers';
import {connect} from 'react-redux';
import './styles.css';
import Event from '../Event'

const Events = ({events}) => (
    <div className="events">
        {events.map(
            event => (
                <Event key={event} id={event}>
                </Event>
            )
       )}
    </div>
)

export default connect(
    (state) => ({
        events:selectors.getBaby(state,selectors.getSelectedBaby(state))[Object.keys(selectors.getBaby(state,selectors.getSelectedBaby(state)))[3]].filter(id=>id!==undefined)
    }), 
    undefined
)(Events)
